import value from '../../../../assets/scss/_themes-vars.scss';
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import ApexCharts from 'apexcharts';



function MyChart() {
  const [chartData, setChartData] = useState({
    height: 228,
    type: 'pie',
    options: {
      dataLabels: {
        enabled: false,
      },
      labels: ['Total Items', 'Incoming', 'Outgoing'],
      legend: {
        show: true,
        position: 'bottom',
        fontFamily: 'inherit',
        labels: {
          colors: 'inherit',
        },
      },
      itemMargin: {
        horizontal: 10,
        vertical: 10,
      },
      colors: ['#e74c3c', '#3498db', '#2ecc71'],
    },
    series: [70, 10, 12],
  });

  useEffect(() => {
    const chart = new ApexCharts(document.querySelector("#chart"), chartData);
    chart.render();
    return () => chart.destroy();
  }, [chartData]);

  return (
    <div id="chart" />
  );
}

export default MyChart;
